import * as React from 'react';
import Paper from '@material-ui/core/Paper';
import {
  Chart,
  ArgumentAxis,
  ValueAxis,
  BarSeries,
  Title,
  Legend,
} from '@devexpress/dx-react-chart-material-ui';

import { Stack, Animation } from '@devexpress/dx-react-chart';

export const population = [{
  state: 'USA', maleyoung: 29.956, malemiddle: 90.354, maleolder: 14.472, Attadance: 28.597,
}, {
  state: 'Brazil', maleyoung: 25.607, malemiddle: 55.793, maleolder: 3.727, femaleyoung: 24.67, 
}, {
  state: 'Russia', maleyoung: 13.493, malemiddle: 48.983, maleolder: 5.802, femaleyoung: 12.971,
}, {
  state: 'Japan', maleyoung: 9.575, malemiddle: 43.363, maleolder: 9.024, femaleyoung: 9.105, 
}, {
  state: 'Mexico', maleyoung: 17.306, malemiddle: 30.223, maleolder: 1.927, femaleyoung: 16.632, 
}, {
  state: 'Germany', maleyoung: 6.679, malemiddle: 28.638, maleolder: 5.133, femaleyoung: 6.333, Attadance: 27.693, femaleolder: 8.318,
}, {
  state: 'United Kindom', maleyoung: 5.816, malemiddle: 19.622, maleolder: 3.864, femaleyoung: 5.519, Attadance: 19.228, femaleolder: 5.459,
}];

const Root = (props: any) => (
  <Legend.Root
    {...props}
    style={{
      display: 'grid',
      gridTemplateColumns: 'auto auto auto',
      margin: 'auto',
    }}
  />
);


export default class Demo extends React.PureComponent<{},any> {
  constructor(props: any) {
    super(props);

    this.state = {
      population,
    };
  }

  render() {
    const { population: chartData } = this.state;
    return (
      <div className="relative flex flex-col min-w-0 break-words bg-white w-full  mb-6 shadow-lg rounded">
        <div className="rounded-t mb-0 px-4 py-3 bg-transparent">
          <div className="flex flex-wrap items-center">
            <div className="relative w-full max-w-full flex-grow flex-1">
              <h6 className="uppercase text-gray-500 mb-1 text-xs font-semibold">
                Performance
              </h6>
              <h2 className="text-gray-800 text-xl font-semibold">
                Total orders
              </h2>
            </div>
          </div>
        </div>
        <div className="p-4 flex-auto">
          {/* BarChart */}
          <div className="relative h-40vh">
              <Chart
              data={chartData}
              height={400}
            >
              <ArgumentAxis />
              <ValueAxis />

              <BarSeries
                name="Male: 0-14"
                valueField="maleyoung"
                argumentField="state"
              />
              <BarSeries
                name="Male: 15-64"
                valueField="malemiddle"
                argumentField="state"
              />
              <BarSeries
                name="Male: 65 and older"
                valueField="maleolder"
                argumentField="state"
              />
              <BarSeries
                name="Attadance: 0-14"
                valueField="Attadance"
                argumentField="state"
              />
              <Animation />
              <Legend position="bottom" rootComponent={Root} />
              <Stack
                stacks={[
                  { series: ['Male: 0-14', 'Male: 15-64', 'Male: 65 and older'] },
                  { series: ['Female: 0-14', 'Female: 15-64', 'Female: 65 and older'] },
                ]}
              />
            </Chart>
          </div>
        </div>
      </div>      
    );
  }
}
